sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new GoogleDirectoryUtils();
    inputs = utils.trimStringInputs(inputs);
    if (utils.isEmpty(inputs.email))
        throw new Error("Group mail cannot be empty")
    var payload = {
        email: inputs.email
    };
    if (inputs.description)
        payload.description = inputs.description;
    if (inputs.name)
        payload.name = inputs.name;
    outputs.payload = JSON.stringify(payload);
})(inputs, outputs);

